import {Outlet, Link} from "react-router-dom";
import "./Layout.css";

const Layout = () =>{
    return(
        <>
        <nav>
            <ul className="nav-links">
                <li><Link to="/"> HOME </Link></li>
                <li><Link to="/allnews"> ALL NEWS </Link></li>
                
            </ul>

            <ul>
                
            </ul>

            <ul>
                <li><Link to="/contactus"> CONTACT US </Link></li>
            </ul>
        </nav>
        <Outlet/>
        </>
    );
};
export default Layout;
